googleAuthApp.service('PDFService',['$http',function($http){
  var self = this;
  var imgData = 'data:image/png;base64,';


  this.makeNewPDF = function(){
    $http({
      method: 'GET',
      url: '/slipnumbers'
    }).then(function success(response){
      console.log(response);
      var doc = new jsPDF();

      doc.setFontSize(20);

      for(var i=0; i<response.data.length;i+4){
        console.log('we in this for loop');
        doc.addImage(imgData, 'JPEG', 0, 0, 210, 180);
        doc.text(10, 95, 'slip number: '+response.data[i]);
        doc.text(110,95, 'slip number: '+response.data[i+1]);
        doc.text(10, 10, 'slip number: '+response.data[i+2]);
        doc.text(110, 10, 'slip number: '+response.data[i+3]);
        if(i !== 36){
          doc.addPage();

        }
      }
      doc.save('SOARSlips.pdf');





    }, function failure(response){
      console.log(response);
    });


  };

}]);
